import React from "react";
class Demo2 extends React.Component {
  render() {
    let object = [10, 20, 30];
    return (
      <>
        {object.map((item, index) => {
          return <p key={index}>{item}</p>;
        })}
        <input type="text" value="" />
        <button>添加</button>
      </>
    );
  }
}
export default Demo2;
